import './App.css';
import ic from './data/informationCountry';

function App() {
  return (
    <div className="">
      {ic.map((data)=>(
        <div>
          <span>Name Country:{data.name.official}</span>
        </div>
      ))}
    </div>
  );
}

export default App;
